--
-- Name: latest_price_history; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.latest_price_history AS
 SELECT code,
    tenant_id,
    fournisseur,
    prix_achat,
    quantite,
    facture_date,
    source_context,
    created_at
   FROM ( SELECT produits_price_history.id,
            produits_price_history.tenant_id,
            produits_price_history.code,
            produits_price_history.fournisseur,
            produits_price_history.prix_achat,
            produits_price_history.quantite,
            produits_price_history.facture_date,
            produits_price_history.source_context,
            produits_price_history.created_at,
            row_number() OVER (PARTITION BY produits_price_history.tenant_id, produits_price_history.code ORDER BY produits_price_history.facture_date DESC NULLS LAST, produits_price_history.created_at DESC) AS row_num
           FROM public.produits_price_history) ranked
  WHERE (row_num = 1);


