--
-- Name: restaurant_sales_consumptions; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.restaurant_sales_consumptions AS
 SELECT s.tenant_id,
    map.produit_restaurant_id,
    map.produit_epicerie_id,
    COALESCE(p.nom, ''::text) AS epicerie_nom,
    COALESCE(p.categorie, ''::text) AS epicerie_categorie,
    COALESCE(p.prix_achat, (0)::numeric) AS prix_achat,
    COALESCE(p.prix_vente, (0)::numeric) AS prix_vente,
    COALESCE(p.stock_actuel, (0)::numeric) AS stock_actuel,
    COALESCE(sum((s.quantity * COALESCE(map.ratio, (1)::numeric))), (0)::numeric) AS quantity_consumed,
    ceil(COALESCE(sum((s.quantity * COALESCE(map.ratio, (1)::numeric))), (0)::numeric)) AS bottles_required,
    COALESCE(sum(((s.quantity * COALESCE(map.ratio, (1)::numeric)) * COALESCE(p.prix_achat, (0)::numeric))), (0)::numeric) AS cost_spent,
    (COALESCE(p.stock_actuel, (0)::numeric) - COALESCE(sum((s.quantity * COALESCE(map.ratio, (1)::numeric))), (0)::numeric)) AS stock_after_sales,
    max(s.sold_at) AS last_sale_at
   FROM ((public.restaurant_sales s
     JOIN public.restaurant_epicerie_sku_map map ON (((map.produit_restaurant_id = s.plat_id) AND (map.tenant_restaurant = s.tenant_id))))
     LEFT JOIN public.produits p ON (((p.id = map.produit_epicerie_id) AND (p.tenant_id = map.tenant_epicerie))))
  GROUP BY s.tenant_id, map.produit_restaurant_id, map.produit_epicerie_id, p.nom, p.categorie, p.prix_achat, p.prix_vente, p.stock_actuel;


ALTER VIEW public.restaurant_sales_consumptions OWNER TO postgres;

